import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { Box, Typography, TextField, Button } from "@mui/material";

const SignUpStep2: React.FC = () => {
    const navigate = useNavigate();
    const [name, setName] = useState("");
    const [icNumber, setIcNumber] = useState("");
    const [address, setAddress] = useState("");

    const handleNext = () => {
        // TODO: Save info to backend
        navigate("/signup-voice");
    };

    return (
        <Box textAlign="center" mt={5}>
            <Typography variant="h4">Confirm Your Info</Typography>
            <TextField label="Full Name" value={name} onChange={(e) => setName(e.target.value)} fullWidth sx={{ my: 1 }} />
            <TextField label="IC Number" value={icNumber} onChange={(e) => setIcNumber(e.target.value)} fullWidth sx={{ my: 1 }} />
            <TextField label="Address" value={address} onChange={(e) => setAddress(e.target.value)} fullWidth sx={{ my: 1 }} />

            <Button variant="contained" sx={{ mt: 3 }} onClick={handleNext}>
                Next
            </Button>
        </Box>
    );
};

export default SignUpStep2;
